import React, { Component } from 'react';
import './App.css';

class App extends Component {
constructor(props) {
  super(props);
  console.log("This is my initializer");

  const movies = [
    {id: 0, title: "Avangers", overview: "Text1"},
    {id: 1, title: "Avangers", overview: "Text2"},
  ];

  this.state = {rows: [
    <p key="1">This is my row</p>,
    <p key="2">This is my row</p>, 
    <p key="3">This is my row</p>
  ]}

  var movieRows = []
  movies.forEach((movie) => {
    console.log(movie.title);
    const movieRow = <table key={movie.id}>
      <tbody>
        <tr>
          <td>
            <img src=""></img>
          </td>
          <td>
            {movie.title}
          </td>
        </tr>
      </tbody>
    </table>
    movieRows.push(movieRow)
  });

  this.state = {rows: movieRows}
}

  render() {
    return (
      <div className="App">

        <table className="titleBar">
          <tbody>
            <tr>
              <td>
                <img  alt="app icon" width="50" src="green_app_icon.svg"/>
              </td>
              <td width="8"></td>
              <td>
                <h1>MoviesDB Search</h1>
              </td>
            </tr>
          </tbody>
        </table>

        <input style={{
          fontSize: 24,
          display: 'block',
          width: "99%",
          paddingTop: 8,
          paddingBottom: 8,
          paddingLeft: 16
        }} placeholder="Enter search term"></input>

        {this.state.rows}

      </div>
    );
  }
}

export default App;
